issue.body:
how is it possible to execute a select handler not only for click but also for keyboard select events?
Example Code from uikit page with additional data-id value
```code
<div class="uk-autocomplete uk-form" data-uk-autocomplete="{source:'my-autocomplete.json'}">
    <input type="text">
    <script type="text/autocomplete">
        <ul class="uk-nav uk-nav-autocomplete uk-autocomplete-results">
            {{~items}}
            <li class="clicked" data-value="{{ $item.value }}"  data-id="{{ $item.id }}">
                <a>
                    {{ $item.title }}
                    <div>{{{ $item.text }}}</div>
                </a>
            </li>
            {{/items}}
        </ul>
    </script>
</div>
```

```javascript
<script>
$(document).ready(function() {
$(document).on( "click", "li.clicked", function(  ) {
   alert($(this).attr('data-id'));
});
// The question here: how to bind this handler when a value 
// has been selected by keyboard and return key?
});
</script>
```
